import React, { Component } from 'react';
import './notfound.css';
import { Link } from 'react-router-dom';

const notFound = () => {
    return ( 
        <React.Fragment>
            <h1>OOPS!</h1>
            <p>The page you are looking for can't be found</p>
            <Link to="./home">Go To Home</Link>
        </React.Fragment>
    );
}
 
export default notFound;
